import Box from "@mui/material/Box";
import Drawer from "./components/Sidebar//DrawerComponent";
import CssBaseline from "@mui/material/CssBaseline";
import Toolbar from "./components/Sidebar/ToolbarComponent";
import "./App.css";

function App() {
  return (
    <>
      <Box sx={{ display: "flex" }}>
        <CssBaseline />
        <Drawer />
        <Box
          component="main"
          sx={{ flexGrow: 1, zIndex: 0 }} // Defina um z-index menor que o Drawer para garantir que o Drawer fique atrás
        >
          <Toolbar />
          {/* Aqui você pode colocar o resto do conteúdo da sua aplicação */}
        </Box>
      </Box>
    </>
  );
}

export default App;
